import React from "react";
import "./ProfessionalTemplate.css";

const ProfessionalTemplate = ({ resumeData }) => {
  return (
    <div className="professional-template">
      <header className="professional-header">
        <div className="professional-name-title">
          <h1>{resumeData.name}</h1>
          <div className="professional-contact">
            <span>{resumeData.email}</span>
          </div>
        </div>
      </header>

      <main className="professional-main">
        <section className="professional-section">
          <h2>Professional Summary</h2>
          <div className="professional-summary">
            <p>
              Experienced professional with expertise in{" "}
              {resumeData.skills?.slice(0, 3).join(", ")} and more.
            </p>
          </div>
        </section>

        <section className="professional-section">
          <h2>Core Competencies</h2>
          <div className="professional-skills">
            {resumeData.skills?.map((skill, index) => (
              <div key={index} className="professional-skill-item">
                â€¢ {skill}
              </div>
            ))}
          </div>
        </section>

        <section className="professional-section">
          <h2>Professional Experience</h2>
          <div className="professional-experience">
            {resumeData.experience?.split("\n").map((exp, index) => (
              <p key={index}>{exp}</p>
            ))}
          </div>
        </section>

        <section className="professional-section">
          <h2>Education</h2>
          <div className="professional-education">
            {resumeData.education?.split("\n").map((edu, index) => (
              <p key={index}>{edu}</p>
            ))}
          </div>
        </section>
      </main>
    </div>
  );
};

export default ProfessionalTemplate;
